import React from "react";
import { Box, Flex, IconButton, Link, Text} from "@chakra-ui/core";
import NextLink from "next/link";
import {RegularWorkoutFragment} from "../generated/graphql";

interface DaySectionProps {
  workout: RegularWorkoutFragment;
}

export const DaySection: React.FC<DaySectionProps> = ({
  workout
}) => {


  return (
    <>
    {workout ? (
      <Box p={5} shadow="md" borderWidth="1px">
          <Text>{workout.workoutDt.slice(0,10)}</Text>
          <Flex align="center">
            <Text flex={1} mt={4}>
              {workout.workoutType}
            </Text>
          </Flex>
      </Box>
    ) : null
    }
    </>
  );
};
